  'A plasticky bullpup (short-stocked) assault rifle covered in futuristic ridges and macho filigrees, this gun looks like a reincarnated Adidas shoe with murder on its mind. Despite its visual distinctiveness, it has yet to make its mark on the movies, where so far it has been used chiefly for zombie abatement.',
  13,
  5,
  1,
  'Modern',
  2,
  NOW(),
  NOW()
) ON CONFLICT (id) DO NOTHING;

