  'Desert Eagle .357 Magnum',
  'Wins the brand-name recognition contest in the really-big-handgun category. Finish comes in your choice of black oxide, nickel, or chrome. Hey, if you’re going to wave something this big around, you might as well go for the chrome.',
  11,
