INSERT INTO weapons (
  id, campaign_id, name, description, damage, concealment, reload_value,
  juncture, mook_bonus,
  created_at, updated_at
) VALUES (
  'cf812427-8794-4307-8554-0e36498a7815',
  '7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2',
  'M16',
  'The basic rifle of the US army, among many other militaries, including Furious George’s. Since these weapons aren’t manufactured for the consumer market, flash and marketing glitz aren’t a factor here. There are lots of variations on this one, none of which have cool names so let’s just call them all M16s and be done with it. Today’s rifle hobbyists favor the version marketed by Colt as the AR-15. But if you’re threatening someone, you still tell them you’re going to come around their place with an M16.  Military characters instead carry M4s, the present- day descendant of the M16 now replacing it throughout the US military.',
  13,
  5,
  1,
  'Modern',
  1,
  NOW(),
  NOW()
) ON CONFLICT (id) DO NOTHING;

