  'Beretta M12 Submachinegun',
  '<p>First designed for the Italian police, the modern model of this compact machine gun provides extra safety against accidental misfire. Its pistol grip qualifies it for use with the Both Guns Blazing gun schtick. Appears in many John Woo movies.</p>',
  10,
