  'FN P90',
  'New gun designs don’t come along that often, but this Belgian weapon, first manufactured in 1990, fits that bill in weirdly curved spades. Packing a small rifle-round punch into a relatively compact frame, it appeals to shooters needing portability, from vehicle patrollers to counter-insurgents. Your gun expert character, while someone is shooting it at him, might want to explain that this is not strictly speaking a submachine gun, but rather belongs to the blandly explanatory category of “personal defense weapon.”',
