  'Grendel P-30',
  'This .22 autoloader looks like something out of the 1930s Flash Gordon serials and has a downright wacky capacity. Your character may be taunted for being seen in public with this oddity, but then again, it is named after the monster that Beowulf fought, and that oughta count for something.',
