  'Smith & Wesson 3566',
  '.356 autoloader pistol. If you’re going to go for an easily-spotted, high-power weapon, you might as well pick one that you don’t have to reload every sequence. Real-world shooters would be scared off by the unusual ammo, but that’s not a problem for PCs who can seamlessly source difficult supplies between scenes.',
